import React from "react";
import { Routes, Route, Navigate } from "react-router-dom";
import Home from "./pages/home_page_ui";
import PatientAuthModal from "./pages/patient/PatientAuthModal";
import PatientDashboard from "./pages/patient/PatientDashboard";
import Records from "./pages/patient/Records";
import Reports from "./pages/patient/Reports";
import AccessLogs from "./pages/patient/AccessLogs";
import ProtectedRoute from "./components/ProtectedRoute";

export default function App() {
  return (
    <Routes>
      <Route path="/" element={<Home />} />

      {/*
        Map both `/login` and `/patient/modal` to the same component
        so any “/login” link will show the patient modal.
      */}
      <Route path="/login" element={<PatientAuthModal />} />
      <Route path="/patient/modal" element={<PatientAuthModal />} />

      {/* Patient‐only pages */}
      <Route
        path="/dashboard"
        element={<ProtectedRoute><PatientDashboard/></ProtectedRoute>}
      />
      <Route
        path="/records"
        element={<ProtectedRoute><Records/></ProtectedRoute>}
      />
      <Route
        path="/reports"
        element={<ProtectedRoute><Reports/></ProtectedRoute>}
      />
      <Route
        path="/access-logs"
        element={<ProtectedRoute><AccessLogs/></ProtectedRoute>}
      />

      {/*
        Redirect any unknown “/doctor/login” to your doctor‐login route.
        Replace `/doctor/login` below with whichever path your doctor login actually lives at.
      */}
      <Route
        path="/doctor/login"
        element={<Navigate to="/login" replace />}
      />

      {/*
        Catch‐all: redirect everything else home
      */}
      <Route path="*" element={<Navigate to="/" replace />} />
    </Routes>
  );
}
